/*-- Global Variables --*/
:root{
--body-font:'Poppins','Kantumruy Pro',sans-serif;
--main-color:#009688;
--main-light-color:#00968810;
--text-color:#4d4e54;
--white-color:#ffffff;
--black-color:#000000;
--border-color:rgba(155,155,155,0.19);
--shadow:0 1px 3px rgba(0,0,0,0.17);
--radius:5px;
}
/*-- Theme Style --*/
*{word-wrap:break-word;-webkit-font-smoothing:antialiased;-webkit-text-size-adjust:100%;text-decoration:none;outline:none;box-sizing:border-box;padding:0;margin:0}
body{background:var(--black-color);font-family:var(--body-font);font-size:1rem;color:var(--text-color);font-weight:400;line-height:1.4em}
body.has-form{background:var(--main-color)}
h1,h2,h3,h4,h5{font-weight:700;line-height:1.5em;margin:0}
a{color:var(--main-color)}
input,select,textarea,button{background:transparent;font-family:inherit;font-weight:400;-webkit-appearance:none;-moz-appearance:none;appearance:none;border:0;border-radius:0}
#site-outer{position:relative;display:flex;flex-direction:column;align-items:center;justify-content:center}
.container{position:relative;display:flex;flex-direction:column;align-items:center;justify-content:center;gap:30px;width:620px;max-width:calc(100% - 32px);margin:30px auto}
.heading-title{font-size:1.5rem;color:var(--white-color);text-align:center}
a.heading-link{color:var(--white-color);transition:all .17s ease}
a.heading-link:hover{color:var(--black-color)}
#form{width:100%;display:grid;grid-template-columns:1fr;gap:16px;background:var(--white-color);padding:28px;box-shadow:var(--shadow);border-radius:var(--radius)}
#form .form-group{display:grid;grid-template-columns:1fr;gap:8px}
#form label{color:var(--main-color);font-weight:500}
#form input{width:100%;height:48px;background:var(--white-color);font-size:15px;color:var(--text-color);caret-color:var(--main-color);padding:8px 16px;border:1px solid var(--border-color);border-radius:var(--radius);transition:all .17s ease-in-out}
#form input::placeholder{color:var(--text-color);opacity:.65}
#form input:focus{border-color:var(--main-color)}
#form input[readonly]{background:var(--main-light-color)}
#form small.error-msg1,#form small.error-msg2{display:none;color:#ff0000}
#form small.error-msg1.show,#form small.error-msg2.show{display:block}
#form .form-button{position:relative;display:flex;gap:20px;align-items:center;justify-content:center}
#form button{padding:10px 20px;margin:10px 0 0;background:var(--main-color);color:var(--white-color);font-size:1rem;font-weight:600;cursor:pointer;box-shadow:var(--shadow);border-radius:var(--radius);transition:all .17s ease}
#form button:hover{opacity:.9}
#copyright{color:var(--white-color);text-align:center}
/*-- Player Style --*/
#player{position:absolute;top:0;left:0;width:100%!important;height:100%!important;overflow:hidden}
.jwplayer.jw-skin-rock .jw-display-icon-rewind,.jwplayer.jw-skin-rock .jw-icon-rewind,.jwplayer.jw-skin-rock .jw-display-icon-next{display:none}
.jwplayer.jw-skin-rock .jw-text-track-display .jw-text-track-cue{font-family:var(--body-font)}

--></style>
